import React from 'react';
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";


function Notes(){
    return(
        <div>
           Tej's Notes App 
           <div>
               <Router>
                    <li>
                        <Link to="/app" style ={heading} onClick ={<Notes/>}>Success! Click to Continue to Application</Link>
                    </li>
                    <Routes>
                        <Route exact path="/app" element = {<Notes/>} />
                    </Routes>
               </Router>

             </div> 
        </div>
    );
}export default Notes;
